import React from 'react';   
import './style/popup.css'
class Popup extends React.Component {  
  render() {  
return (  
<div className='popup'>  
<div className='popup\_inner'>  
<p>{this.props.text}</p>  
<button onClick={this.props.closePopup}>Ok</button>  
</div>  
</div>  
);  
}  
}  

export default Popup;
